import { ThemeOptions } from '@mui/material/styles';

export const themeOptions= {
  palette: {
    mode: 'dark',
    primary: {
      main: '#fafbfb',
      light: '#f1ecec',
    },
    secondary: {
      main: '#757575',
    },
    background: {
      paper: '#0C1926',
      default: '#0A202E',
    },
  },
  spacing: 8
};
